import React from "react";
import './../css/option_entry.css';
import {Header} from "./header";
import ReactToPrint from 'react-to-print';
import { NepaliDatePicker } from "datepicker-nepali-reactjs";
export class OptionEntry extends React.Component{
    constructor() {
        super();
        this.state = {

        }
    }
    render() {
        return (
            <div id='option_entry'>
                <Header/>
                <div id="container">
                    <div id="title">
                        विवरणहरु अध्यावधिक गर्नुहोस
                    </div>
                    <div id="entry">
                        <div id="select_item">
                            <select>
                                <option>बैङ्क सम्बन्धि विवरण</option>
                                <option>प्रमुख प्रशासकीय अधिकृत सम्बन्धि विवरण</option>
                                <option>लागत व्यहोर्ने स्रोतहरु</option>
                            </select>
                        </div>
                        <div className="item">
                            <div id="input">
                                <span>बैङ्कको नाम</span>
                                <input type="text" placeholder="बैङ्क नाम"/>
                            </div>
                            <div id="input">
                                <span>बैङ्कको ठेगाना</span>
                                <input type="text" placeholder="बैङ्कको ठेगाना"/>
                            </div>
                            <div id="input">
                                <span>प्रमुख प्रशासकीय अधिकृतको नाम</span>
                                <input type="text" placeholder="प्रमुख प्रशासकीय अधिकृतको नाम"/>
                            </div>
                            <div id="input">
                                <span>प्रमुख प्रशासकीय अधिकृतको ठेगाना</span>
                                <input type="text" placeholder="प्रमुख प्रशासकीय अधिकृतको ठेगाना"/>
                            </div>
                            <div id="input">
                                <span>लागत व्यहोर्ने स्रोत</span>
                                <input type="text" placeholder="लागत व्यहोर्ने स्रोत"/>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
